The graph of $y=f(x)$ is shown below, with $1$ unit between grid lines. Assume $f(x)$ is defined only on the domain shown.

What is the sum of all integers $c$ for which the equation $f(x)=c$ has exactly $6$ solutions?

[asy]
size(150);
real ticklen=3;
real tickspace=2;

real ticklength=0.1cm;
real axisarrowsize=0.14cm;
pen axispen=black+1.3bp;
real vectorarrowsize=0.2cm;
real tickdown=-0.5;
real tickdownlength=-0.15inch;
real tickdownbase=0.3;
real wholetickdown=tickdown;
void rr_cartesian_axes(real xleft, real xright, real ybottom, real ytop, real xstep=1, real ystep=1, bool useticks=false, bool complexplane=false, bool usegrid=true) {

import graph;

real i;

if(complexplane) {

label("$\textnormal{Re}$",(xright,0),SE);

label("$\textnormal{Im}$",(0,ytop),NW);

} else {

label("$x$",(xright+0.4,-0.5));

label("$y$",(-0.5,ytop+0.2));

}

ylimits(ybottom,ytop);

xlimits( xleft, xright);

real[] TicksArrx,TicksArry;

for(i=xleft+xstep; i<xright; i+=xstep) {

if(abs(i) >0.1) {

TicksArrx.push(i);

}

}

for(i=ybottom+ystep; i<ytop; i+=ystep) {

if(abs(i) >0.1) {

TicksArry.push(i);

}

}

if(usegrid) {

xaxis(BottomTop(extend=false), Ticks("%", TicksArrx ,pTick=gray(0.22),extend=true),p=invisible);//,above=true);

yaxis(LeftRight(extend=false),Ticks("%", TicksArry ,pTick=gray(0.22),extend=true), p=invisible);//,Arrows);

}

if(useticks) {

xequals(0, ymin=ybottom, ymax=ytop, p=axispen, Ticks("%",TicksArry , pTick=black+0.8bp,Size=ticklength), above=true, Arrows(size=axisarrowsize));

yequals(0, xmin=xleft, xmax=xright, p=axispen, Ticks("%",TicksArrx , pTick=black+0.8bp,Size=ticklength), above=true, Arrows(size=axisarrowsize));

} else {

xequals(0, ymin=ybottom, ymax=ytop, p=axispen, above=true, Arrows(size=axisarrowsize));

yequals(0, xmin=xleft, xmax=xright, p=axispen, above=true, Arrows(size=axisarrowsize));

}
};
rr_cartesian_axes(-6,6,-7,7);
real f(real x) {return (x-5)*(x-3)*(x-1)*(x+1)*(x+3)*(x+5)/315-3.4;}
draw(graph(f,-5.5,5.5,operator ..), red);
[/asy]

The hexagon with the R is colored red.  Each hexagon is colored either red, yellow or green, such that no two hexagons with a common side are  colored the same color.  In how many  different ways can the figure be colored?

[asy]
path a=(0,0)--(10,0)--(15,8.7)--(10,17.3)--(0,17.3)--(-5,8.7)--cycle;
draw(a);
draw(shift((15,8.7))*a);
draw(shift((15,-8.7))*a);
draw(shift((30,17.3))*a);
draw(shift((30,0))*a);
draw(shift((30,-17.3))*a);
draw(shift((45,26))*a);
draw(shift((45,8.7))*a);
draw(shift((45,-8.7))*a);
draw(shift((60,17.3))*a);
draw(shift((60,0))*a);
draw(shift((60,-17.3))*a);
draw(shift((75,8.7))*a);
draw(shift((75,-8.7))*a);
label("$R$",(5,10),S);
[/asy]

The exact amount of fencing that enclosed the four congruent equilateral triangular corrals shown here is reused to form one large equilateral triangular corral. What is the ratio of the total area of the four small corrals to the area of the new large corral? Express your answer as a common fraction.

[asy]
draw((0,0)--(1,sqrt(3))--(2,0)--cycle);
draw((1,sqrt(3))--(0,2*sqrt(3))--(2,2*sqrt(3))--cycle);
draw((0,2*sqrt(3))--(-2,2*sqrt(3))--(-1,3*sqrt(3))--cycle);
draw((2,2*sqrt(3))--(4,2*sqrt(3))--(3,3*sqrt(3))--cycle);
label("1", (-1,2.35*sqrt(3)));
label("2", (3,2.35*sqrt(3)));
label("3", (1,1.65*sqrt(3)));
label("4", (1,.35*sqrt(3)));
[/asy]

In rectangle $ABCD$, side $AB$ measures $6$ units and side $BC$ measures $3$ units, as shown. Points $F$ and $G$ are on side $CD$ with segment $DF$ measuring $1$ unit and segment $GC$ measuring $2$ units, and lines $AF$ and $BG$ intersect at $E$. What is the area of triangle $AEB$? [asy]
draw((0,0)--(6,0)--(6,3)--(0,3)--cycle);
draw((0,0)--(2,6)--(6,0)--cycle);
dot((0,0));
dot((6,0));
dot((6,3));
dot((0,3));
dot((1,3));
dot((4,3));
dot((2,6));
label("A",(0,0),SW);
label("B",(6,0),SE);
label("C",(6,3),NE);
label("D",(0,3),NW);
label("E",(2,6),N);
label("F",(1,3),SE);
label("G",(4,3),SW);
label("6",(3,0),S);
label("1",(0.5,3),N);
label("2",(5,3),N);
label("3",(6,1.5),E);
[/asy]

A right circular cone is sliced into four pieces by planes parallel to its base, as shown in the figure. All of these pieces have the same height. What is the ratio of the volume of the second-largest piece to the volume of the largest piece? Express your answer as a common fraction.
[asy]
size(150);
pair A, B, C, D, E, F, G, H, I, w, x, y, z;
A=(0,0);
B=(.25,.75);
C=(.5,1.5);
D=(.75,2.25);
E=(1,3);
F=(1.25,2.25);
G=(1.5,1.5);
H=(1.75,.75);
I=(2,0);
w=(A+I)/2;
x=(B+H)/2;
y=(C+G)/2;
z=(D+F)/2;
draw(ellipse(w, 1, .25));
draw(ellipse(x, .75, .1875));
draw(ellipse(y, .5, .125));
draw(ellipse(z, .25, .0625));
draw(A--E--I);
[/asy]

According to the chart shown, what was the average daily high temperature in Addington from September 15th, 2008 through September 19th, 2008, inclusive? Express your answer as a decimal to the nearest tenth. [asy]
size(300);
defaultpen(linewidth(.7pt)+fontsize(6pt));

int[] highs={49,62,58,57,46};
int[] lows={40,47,45,41,39};

path unithump=(0,0)--(0,1)--(1,1)--(1,0);
path unitcorner=(0,1)--(1,1)--(1,0);

for(int i = 0; i < 5; ++i)
{
transform high=shift(5+20*i,0)*scale(5,highs[i]);
transform low=shift(10+20*i,0)*scale(5,lows[i]);
fill(high*unitsquare,gray);
fill(low*unitsquare,lightgray);
draw(high*unithump);
draw(low*unitcorner);
label(Label(string(highs[i])), (7.5+20*i, highs[i]), N);
label(Label(string(lows[i])), (12.5+20*i, lows[i]), N);
label(Label(format("Sept %i", i+15)), (10+20*i, 0), S);
}

xaxis(xmin=0, xmax=100, above=true);
yaxis(ymin=0, ymax=77, Ticks(Step=10, begin=false, beginlabel=false, step=10, Size=3), above=true);

label(rotate(90)*"Temperature ($^{\circ}$F)", (-15,40), fontsize(8pt));

label("Daily High/Low Temperature in Addington", (50,90), fontsize(10pt));
label("(September 15, 2008 -- September 19, 2008)", (50, 85), fontsize(8pt));
label("\underline{KEY}", (105, 65), E, fontsize(8pt));
label("High Temp.", (113, 59), E, fontsize(8pt));
label("Low Temp.", (113, 53), E, fontsize(8pt));
filldraw(shift(109,58)*scale(3)*unitsquare, gray, black);
filldraw(shift(109,52)*scale(3)*unitsquare, lightgray, black);
[/asy]

In triangle $ABC,$ $AB = 9,$ $BC = 10,$ and $AC = 11.$  If $D$ and $E$ are chosen on $\overline{AB}$ and $\overline{AC}$ so that $AD = 4$ and $AE = 7,$ then find the area of triangle $ADE.$

[asy]
unitsize (1 cm);

pair A, B, C, D, E;

A = (2,3);
B = (0,0);
C = (6,0);
D = interp(A,B,0.4);
E = interp(A,C,3/5);

draw(A--B--C--cycle);
draw(D--E);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$E$", E, NE);
[/asy]

The following line is parameterized, so that its direction vector is of the form $\begin{pmatrix} a \\ -1 \end{pmatrix}.$  Find $a.$

[asy]
unitsize(0.4 cm);

pair A, B, L, R;
int i, n;

for (i = -8; i <= 8; ++i) {
  draw((i,-8)--(i,8),gray(0.7));
  draw((-8,i)--(8,i),gray(0.7));
}

draw((-8,0)--(8,0),Arrows(6));
draw((0,-8)--(0,8),Arrows(6));

A = (-2,5);
B = (1,0);
L = extension(A, B, (0,8), (1,8));
R = extension(A, B, (0,-8), (1,-8));

draw(L--R, red);

label("$x$", (8,0), E);
label("$y$", (0,8), N);
[/asy]
